Model identified during hot reload and only fails after server restart<p>I am connecting to mongodb via mongoose and then creating a model as follows.</p>
<pre><code>// coming from /database/schema
import mongoose from &quot;mongoose&quot;;

const kittySchema = new mongoose.Schema({
    name: String
})

const Kitten = mongoose.model(&quot;Kitten&quot;, kittySchema)

export default Kitten;
</code></pre>
<p>This works first time where I am able to insert into the db.</p>
<p>If I try to insert a second time, end up with following error.</p>
<blockquote>
<p>OverwriteModelError: Cannot overwrite <code>Kitten</code> model once compiled.</p>
</blockquote>
<p>This is cos I am trying to reinsert a model which already exists. So to fix this error, I added a check as follows.</p>
<pre><code>const Kitten = mongoose.model('Kitten') || mongoose.model(&quot;Kitten&quot;, kittySchema)
</code></pre>
<p>This whole time I started the server once locally and been fixing the error while it hot reloads.</p>
<p>Everything works now. Can insert multiple times. But now if I stop the server and restart, I end up with following error.</p>
<blockquote>
<p>MissingSchemaError: Schema hasn't been registered for model &quot;Kitten&quot;.
Use mongoose.model(name, schema)</p>
</blockquote>
<p>THIS is the issue. It doesn't like the fix: <code>mongoose.model('Kitten') ||</code></p>
<p>Why was it ok when I added in while server was on. But facing this error now after I stopped and started server?</p>
<p>P.S: Don't believe the following are relevant. This is how I am connecting and inserting.
<br/>Adding them in case needed.</p>
<pre><code>// coming from /database/connection
import mongoose from &quot;mongoose&quot;;

const connection = async () =&gt; {
    await mongoose.connect(process.env.DB_CONNECTION_STRING)
    console.log('Database connected')
}

export default connection;

import connection from &quot;../database/connection&quot;;
import Kitten from &quot;../database/schema&quot;;

const saveKittens = (req, res) =&gt; {
    connection()
        .catch(error =&gt; console.log(`saveKittens error ${error}`))

    const create = new Kitten({ name: 'test123' })
    create.save().then(() =&gt; {
        res.status(200).json(create)
    })
}

export default saveKittens;
</code></pre>

