How can I fetch the details of the other participant of an array in mongodb<p>I want to get the details of the other participant of the chat (only two partcipants), but I could only fetch the details of the person that fetch the data .</p>
<p>below is my code</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>//Get ChatList
export const getChats = async(req, res) =&gt; {
    const userId = req.params.id

    try {
        const chats = await ChatModel.aggregate([
            {
                $match: {
                    participantId : userId
                }
            },
            { $addFields: {"userObjectid": {"$toObjectId": userId}}},
            {
                $lookup: {
                    from : "users",
                    localField: "userObjectid",
                    foreignField: "_id",
                    as : "userDetails"
                }
            },
            {
                $project: {
                    "_id": 1,
                    "participantId": 1,
                    "lastMessage": 1,
                    "unread": 1,
                    "updatedAt": 1,
                    "userDetails._id" : 1,
                    "userDetails.username" : 1,
                    "userDetails.firstname" : 1,
                    "userDetails.lastname" : 1,
                    "userDetails.profilePicture": 1
                }
            }
        ])

        res.status(200).json(chats.sort((a,b) =&gt;{
            return a.updatedAt - b.updatedAt;
        }))
    } catch (error) {
        res.status(500).json(error)
    }
}</code></pre>
</div>
</div>
</p>

