Liquibase fails with MongoDB<p>I want to get an example of liquibase, Spring and MongoDB all together. In order to do so, I created a Spring project using <a href="https://start.spring.io/" rel="nofollow noreferrer">Spring Initializr</a> with Spring Data MongoDB as dependency. The project already connects to the database and now I would like to use liquibase. I followed the <a href="https://docs.liquibase.com/install/tutorials/mongodb.html" rel="nofollow noreferrer">instructions from liquibase</a> using the maven approach but if I run the maven command <code>mvn liquibase:status</code> I will get the following error:</p>
<pre><code>Unexpected error running Liquibase: Cannot find database driver: com.mongodb.client.MongoClients.&lt;init&gt;()
</code></pre>
<p>It looks like <a href="https://github.com/liquibase/liquibase/issues/1160" rel="nofollow noreferrer">this problem has been already reported to liquibase</a> but if there is a solution it hasn't been posted in the issue.</p>
<p>I tried as well to use the CLI option by adding the jars to the lib folder of the liquibase installation. I got the same error if I run <code>liquibase status</code></p>
<p><a href="https://github.com/legolaz8451/spring-boot-mongo" rel="nofollow noreferrer">I have created a repo in GitHub to show the problem.</a> Here there is some relevant configuration of the code:</p>
<p>pom.xml</p>
<pre><code>&lt;project&gt;
...
&lt;parent&gt;
    &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;
    &lt;artifactId&gt;spring-boot-starter-parent&lt;/artifactId&gt;
    &lt;version&gt;2.7.3&lt;/version&gt;
    &lt;relativePath /&gt; &lt;!-- lookup parent from repository --&gt;
&lt;/parent&gt;
...
&lt;properties&gt;
    &lt;liquibase-mongo-ext.version&gt;4.14.0&lt;/liquibase-mongo-ext.version&gt;
    &lt;liquibase-maven-plugin.version&gt;4.2.0&lt;/liquibase-maven-plugin.version&gt;
&lt;/properties&gt;
&lt;dependencies&gt;
    &lt;dependency&gt;
        &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;
        &lt;artifactId&gt;spring-boot-starter-data-mongodb&lt;/artifactId&gt;
    &lt;/dependency&gt;
    &lt;dependency&gt;
        &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;
