MongoDB - Best way to choose a document based on some condition inside switch case<p>I have a structure where I want to match the value of a field on root level with the value of a field inside another object in the same document and then choose a single document based on some condition from the result. This is the structure I have:</p>
<pre><code>{
   &quot;name&quot;: &quot;somename&quot;,
   &quot;level&quot;: &quot;123&quot;,
   &quot;nested&quot;:[ 
        {
          &quot;somefield&quot;: &quot;test&quot;,
          &quot;file&quot;: {
             level:&quot;123&quot;
         }
     },
     {
         &quot;somefield&quot;: &quot;test2&quot;,
         &quot;file&quot;: {
            level:&quot;124&quot;
         }
     },
     {
         &quot;somefield&quot;: &quot;test3&quot;,
         &quot;file&quot;: {
            level:&quot;123&quot;
         }
     }
  ]
}
</code></pre>
<p>After unwinding and matching it on a condition (<code>level = nested.file.level</code>) I have left with 2 documents:</p>
<pre><code>[
  {
    &quot;level&quot;: &quot;123&quot;,
    &quot;name&quot;: &quot;somename&quot;,
    &quot;nested&quot;: {
      &quot;file&quot;: {
        &quot;level&quot;: &quot;123&quot;
      },
      &quot;somefield&quot;: &quot;test&quot;
    }
  },
  {
    &quot;level&quot;: &quot;123&quot;,
    &quot;name&quot;: &quot;somename&quot;,
    &quot;nested&quot;: {
      &quot;file&quot;: {
        &quot;level&quot;: &quot;123&quot;
      },
      &quot;somefield&quot;: &quot;test3&quot;
    }
  }
]
</code></pre>
<p>Now I want to match on <code>somefield</code>  values, this field has 10 different values, these values are in order so if I find a matching document then I will return it or I will go to the next value in the order and check if <code>&quot;somefield&quot;: &quot;orderedValue&quot;</code> and so on. So for example:</p>
<pre><code>test
test2
test3
test4
test5 
</code></pre>
<p>is the order and if I find a document with has <code>&quot;somefield&quot;: &quot;test&quot;</code> I will only return that document, else I will check for <code>&quot;somefield&quot;: &quot;test2&quot;</code> and so on until I find a single document which satisfies my condition. This is done in order so the first to satisfy the condition that the document I want.</p>
<p>I want to get only 1 document in the end as a result. I thought it would be best to use <code>$switch</code> here and wrote a project stage with $switch.</p>
<pre><code>$project: {
        setting: {
            $switch: {
                branches: [{
                        'case': {
                            $eq: [
                                '$nested.somefield',
                                'test'
                            ]
                        },
                        then: '$nested'
                    },
                    {
                        'case': {
                            $eq: [
                                '$nested.somefield',
                                'test2'
                            ]
                        },
                        then: '$nested'
                    },
                    {
                        'case': {
                            $eq: [
                                '$nested.somefield',
                                'test3'
                            ]
                        },
                        then: '$nested'
                    }
                ],
                'default': 'Did not match'
            }
        }
    }
</code></pre>
<p>But this won't work as this would be applied on each document and if I have 5 documents with 5 of these values then it will match all of them and return the same array of documents. Any idea on how we can return only the document which matched first?</p>

